import React, { useEffect, useState } from "react";
import About from "./components/About";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import useDarkMode from "./hook/useDarkMode";

const App = () => {
  useDarkMode();
  return (
    <div className="bg-gradient-to-b from-white to-white dark:bg-gradient-to-b from-zinc-900 to-zinc-900 w-full transition duration-300">
      <Navbar />
      <Home />
      <About />
    </div>
  );
};

export default App;
